function xorDecrypt(binaryContent, key) {
var ret = new Uint8Array(binaryContent.length);
for (let i = 0; i < binaryContent.length; i++) {
ret[i] = binaryContent.charCodeAt(i) ^ key.charCodeAt(i % key.length);
}
return ret;
}

